  uint256 private firstStepLimit =  0.499999 ether;
  uint256 private secondStepLimit = 1.999999 ether;
  uint256 private thirdStepLimit =  4.999999 ether;
  uint256 private fourthStepLimit = 9.999999 ether;

    // Allows someone to send ether and obtain the token
  function purchase(uint256 _tokenId) public payable {
    address oldOwner = IndexToOwner[_tokenId];
    address newOwner = msg.sender;

    uint256 sellingPrice = IndexToPrice[_tokenId];

    // Making sure token owner is not sending to self
    require(oldOwner != newOwner);

    // Safety check to prevent against an unexpected 0x0 default.
    require(newOwner != address(0));

    // Making sure sent amount is greater than or equal to the sellingPrice
    require(msg.value >= sellingPrice);


    uint256 payment = getPayment(sellingPrice); //-   7%
    uint256 purchaseExcess = SafeMath.sub(msg.value, sellingPrice); //
    uint256 commission = SafeMath.sub(sellingPrice,payment); // 

    uint256 nextPrice = uint256(getNextPrice(sellingPrice));

    //update prices
    IndexToPrice[_tokenId] = nextPrice;
    IndexToRemainPrice[_tokenId] = 0;

    _transfer(oldOwner, newOwner, _tokenId);

    // Pay previous tokenOwner if owner is not contract
    if (oldOwner != address(this)) {
      oldOwner.transfer(payment); //(1-0.07)
    }
    //event 
    BuyToken(_tokenId, sellingPrice, IndexToPrice[_tokenId], oldOwner, newOwner, worldheritages[_tokenId].name);

    msg.sender.transfer(purchaseExcess);
    ceoAddress.transfer(commission); 
  }

  function getNextPrice(uint256 _curPrice) internal view returns (uint256) {
    uint256 nextPrice;
         // calculate price
    if (_curPrice <= firstStepLimit) {
      // first stage  0.01 - 0.5  7%
      nextPrice = SafeMath.div(SafeMath.mul(_curPrice, 200), 100);
    } else if (_curPrice <= secondStepLimit) {
      // second stage 0.5 - 2.0  5%
      nextPrice = SafeMath.div(SafeMath.mul(_curPrice, 135), 100);
    } else if (_curPrice <= thirdStepLimit) {
      // third stage  2.0 -5.0  3%
      nextPrice = SafeMath.div(SafeMath.mul(_curPrice, 125), 100);
    } else if (_curPrice <= fourthStepLimit) {
    // fourth stage  5.0 - 10.0  3&
      nextPrice = SafeMath.div(SafeMath.mul(_curPrice, 117), 100);
    } else {
     // > 10  2%
      nextPrice = SafeMath.div(SafeMath.mul(_curPrice, 115), 100);
    }
    return nextPrice;
    }

    function getPayment(uint256 _curPrice) internal view returns (uint256) {
    uint256 payment;
     // Update prices
    if (_curPrice <= firstStepLimit) {
      // first stage  0.01 - 0.5  7%
      payment = uint256(SafeMath.div(SafeMath.mul(_curPrice, 93), 100));
    } else if (_curPrice <= secondStepLimit) {
